import { React, useState } from 'react';
import NavMenu from './components/Navbar/NavMenu';
import { Route, Switch } from "react-router-dom";
import NutritionAnalysis from './components/Navbar/Pages/NutritionAnalysis';
import Recipes from './components/Navbar/Pages/Recipes';
import BmiPage from './components/Navbar/Pages/BmiPage';
import Articles from './components/Navbar/Pages/Articles';
import Register from './components/Account/Register';
import LogIn from './components/Account/LogIn/LogIn';
import Hom from './components/Account/Logout/Logout';
const token = localStorage.getItem("food-token")
const App = () => {
  return (
    <div >
      <NavMenu />
      <Switch>
        <Route path="/" exact>
          <h1>Hallo hier ist Tareq</h1>
        </Route>
        <Route path='/nutrition-analysis'>
          <NutritionAnalysis />
        </Route>
        <Route path='/recipes'>
          <Recipes />
        </Route>
        <Route path='/bmi'>
          <BmiPage />
        </Route>

        {!token && (
          <>
            <Route path='/register'>
              <Register />
            </Route>
            <Route path='/login'>
              <LogIn />
            </Route>
          </>
        )}

      </Switch>

      <Articles />
    </div>
  );
}


export default App;
